  false,\n\t\"url\": null,\n\t\"notes\": \"The accompanying \"Lower_Platte_GAGES5\"
  data release consists of two parts, a spatial data layer composed of a vector point
  data set representing five USGS streamflow gaging stations, and a relational tabular
  database. The relational database is populated with an inventory and summary of
  selected river discharge measurements along with a table of measurement details
  for each selected discharge measurement. The spatial data layer was created from
  published coordinates of decimal degrees for each gaging station. The tabular database
  was developed chiefly from the archived Discharge Measurement Notes forms on file
  in the USGS offices, Lincoln, Nebr. The geographic scope is limited to the lower
  Platte River of eastern Nebraska, and specifically to five selected streamflow-gaging
  stations located near Duncan, Ashland, North Bend, Leshara, and Louisville. The
  data were assembled for the purpose of conducting an analysis of temporal changes
  in hydraulic and channel geometry characteristics of the lower Platte River over
  five 10-year periods.\",\n\t\"owner_org\": \"bd2cdd5a-4d65-46c0-9937-c8381175f104\",\n\t\"extras\":
